import React from "react";
import { Emoji } from "react-apple-emojis";

import {
  Box,
  Grid,
  Container,
  Typography,
  Card,
  CardMedia,
} from "@mui/material";

import Navigation from "./Navigation.js";

function Header() {
  return (
    <Container>
      {/* Navigation Links */}
      <Box sx={{ py: { xs: 2, sm: 4 } }}>
        <Navigation />
      </Box>
      {/* Heading/Introduction */}
      <Box sx={{ py: { xs: 2, sm: 4 } }}>
        <Grid container spacing={2}>
          {/* Image of Me */}
          <Grid item xs={12} sm={6}>
            <Card>
              <CardMedia
                component="img"
                height="400"
                image={require("./img/profilepic.JPG")}
                alt="Profile Pic"
              />
            </Card>
          </Grid>
          {/* Bio */}
          <Grid item xs={12} sm={6}>
            {/* Greeting */}
            <Box sx={{ pl: { xs: 0, sm: 3} }}>
              <Typography variant="h4">
                <Emoji name="waving-hand" width={28} />
                {" "}Hello
              </Typography>
              <Typography variant="h3">I'm Justin</Typography>
              {/* Facts */}
              <Box sx={{ py: { xs: 2, sm: 4}}} >
                <Typography variant="p">
                  <Box sx={{ border: 5, display: 'inline'}} >
                    <Emoji name="round-pushpin" width={32}/>
                  </Box>
                  {" "}southern california</Typography>
              </Box>
            </Box>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}

export default Header;
